import React, { StrictMode } from "react";
import { NavVertical } from "../../components/Nav";

class ContentsPage extends React.Component {
    Computing() {
        return (
            <StrictMode>
                <section className="container-md p-3">
                    <h2>Bienvenido Allstudy</h2>
                    <section className="container-md p-3">
                        Lorem ipsum dolor sit amet, consectetur adipiscing elit,
                        sed do eiusmod tempor incididunt ut labore et dolore
                        magna aliqua. Ut enim ad minim veniam, quis nostrud
                        exercitation ullamco laboris nisi ut aliquip ex ea
                        commodo consequat. Duis aute irure dolor in
                        reprehenderit in voluptate velit esse cillum dolore eu
                        fugiat nulla pariatur. Excepteur sint occaecat cupidatat
                        non proident, sunt in culpa qui officia deserunt mollit
                        anim id est laborum.
                    </section>
                </section>
            </StrictMode>
        );
    }
    Render() {
        return (
            <StrictMode>
                <section>
                    <nav className="nav-vertical">
                        <NavVertical />
                    </nav>
                </section>
                <this.Computing />
            </StrictMode>
        );
    }
}

const Contents = new ContentsPage();
const Render = Contents.render();

export {
    Render as ContentsPage
}
